import Header from "./Components/Header";
import "./App.css";
import { Container } from "react-bootstrap";
import Footer from "./Components/Footer";

function App() {
  return (
    <>
      <Header />

      <main>
        <Container>
          <h1>Welcome to our product page</h1>
        </Container>
      </main>
      <Footer />
    </>
  );
}

export default App;
